$(document).ready(function(){
  $('.onewayTab').click(function () {
    $(".onewayTab").addClass("active");
    $(".roundTab").removeClass("active");
    $(".multiTab").removeClass("active");
    $(".hasDatepicker").show();
  });
  $('.roundTab').click(function () {
    $(".roundTab").addClass("active");
    $(".onewayTab").removeClass("active");
    $(".multiTab").removeClass("active");
    $(".hasDatepicker").show();
  });
  $('.multiTab').click(function () {
    $(".multiTab").addClass("active");
    $(".onewayTab").removeClass("active");
    $(".roundTab").removeClass("active");
    $(".hasDatepicker").hide();
  });
});